column8:
●メーカー名：（株）リクルーブ ●重量：70g●配合成分：石ケン素地・スクロース・グリセリン・水・イソプロパノール・アスタキサンチン・バラエキス・ローズ水・海水・ヒアルロン酸Na・グリチルリチン酸2K・ラウリル酸ポリグリセリル-10・ステアリン酸スクロース・トコフェロール・エチドロン酸・香料。 ●美容効果で注目を集めているアスタキサンチン配合の石鹸。●ふわふわの泡で優しく洗い上げます。●ほのかなローズの香り。 ●お肌に異常が生じていないかよく注意して使用してください。　●お肌に合わないときはご使用をおやめください。●石鹸の泡が眼に入らないよう注意してください。●万一眼に入った場合は水で十分に洗い流してください。●保管は、乳幼児の手の届かない場所・直射日光・高温多湿は避けてください。●開封後はすぐにご使用ください。

